import React, { Component } from 'react';
import './Landing.css'

class Landing extends Component {
  state = {
    clicked: false
  };

  onSubmit = async () => {
    const res = await fetch("/login/auth/spotify").catch(e => console.log(e));
  }

  render() {
    return (
      <div class="landing">
        <h1>Sync<span>.</span></h1>
        <h3>Login to Spotify to start syncing your music with friends!</h3>
        <button><a onClick={() => this.onSubmit()}>Login with Spotify</a></button>
      </div>
    );
  }

}

export default Landing;
